import React from 'react';
import '../../Styles/About.css';

export default function About() {
    return (
        <div id="about">
            <div className="container p-5">
                    <div className="row filaAbout">
                        
                        <div className="col-12 col-md-2 col-lg-2 d-flex justify-content-center">
                            <div className="cartaBG"></div>
                            <img src={require('../../Images/About.jpeg')} alt="about" className="imgAbout"></img>
                        </div>
                        
                        <div className="col-6 col-md-3 col-lg-3 d-flex justify-content-center">

                        </div>

                    </div>
            </div>
        </div>
    )
}
